// Footer.js
import React from "react";

const Footer = () => {
  return (
    <footer style={{ backgroundColor: "#282c34", height: "50px", color: "white", display: "flex", justifyContent: "center", alignItems: "center" }}>
      <h2>WELCOME</h2>
    </footer>
  );
};

export default Footer;
